document.getElementById("navbar-burger").addEventListener("click",e=>{e.preventDefault();const t=e.currentTarget,a=document.getElementById("navbar-menu");a.classList.toggle("is-active"),a.classList.contains("is-active")?(t.setAttribute("aria-expanded","true"),t.classList.add("is-active")):(t.setAttribute("aria-expanded","false"),t.classList.remove("is-active"))});